import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
class Menu extends Component {
    render() {
        return (
            <div>
                <nav>
                    <ui className="nav-links">
                        <NavLink   activeStyle={{
    fontWeight: "bold",
    color: "red"
  }} to ='/'>
                            <div><li>Home</li></div>
                        </NavLink>
                        <NavLink exact to='/review'>
                           <div><li>Views</li> </div> 
                        </NavLink>

                    </ui>
                </nav>
            </div>
        );
    }
}

export default Menu;
